import react from "react";
import "./Terms.css";

function Terms() {
  return (
    <div className="terms-conditions-div">
      <h1>Terms & Conditions</h1>
      <section className="terms-conditions-section">
        <h2 className="title">Terms & Conditions</h2>
        <h3>Introduction</h3>
      </section>
    </div>
  );
}

export default Terms;
